import React from 'react';
import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, Table, ListGroupItem, ButtonGroup,  Badge } from 'reactstrap';

export default class Example extends React.Component {


  constructor (props){
    super(props);

    this.state={
      checked: false,
      clicked_id: [],
      songsForPlaylist: [],
      isloaded: false,
      playlistsToBeAdded: [],
      allPlaylist:[],

      newPlaylist: "",
      newPlaylistID:1,
    };

    this.handleClick= this.handleClick.bind(this);
    this.handleClick2= this.handleClick2.bind(this);
    this.handleChange= this.handleChange.bind(this);
    this.handleChange2=this.handleChange2.bind(this);

  }


  handleChange(event) {
    this.setState({newPlaylist: event.target.value});
    }
  handleChange2(event) {
    this.setState({newPlaylistID: event.target.value});
    }

  component2(){
    fetch('https://se3309-final-project-amali28.c9users.io:8081/userplaylists/12345')
    .then(res=> res.json())
    .then(json => {
   this.setState({
        isloaded: true,
        allPlaylist: json,
      })
    });
  }

  handleClick(){
   // console.error("fetch")
    this.component2()
  }

  handleClick2(){
    var nameobj= {"name": this.state.newPlaylist,
                  "ID": this.state.newPlaylistID
    };
   console.error(nameobj.name);

  }
  render() {

    var{isloaded, allPlaylist}= this.state;

    return (

      <Form class="2">
        <Row form>
          <Col md={6}>
            <FormGroup>
              <h3 for="Playlist">Create a Playlist</h3>
              <Input type="text" name="Playlist" id="exampleEmail" placeholder="Enter playlist Name..." 
                 value={this.state.value}
                  onChange={this.handleChange}/>
              <Input type="text" name="Playlist" id="exampleEmail" placeholder="Enter playlist ID..." 
                 value={this.state.value}
                  onChange={this.handleChange2}/>

              <Button  onClick= {this.handleClick2} id="createPlaylist">Add New Playlist</Button>


            </FormGroup>
          </Col>
        </Row>

        <br></br>
        <h3>Songs Added</h3>
          <li key={this.clicked_id}></li>
        <br></br>
        <Button  onClick= {this.handleClick} id="createPlaylist">Get All playlists</Button>



      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>Date Created</th>
            <th>User ID</th>
            <th>Playlist Name</th>
          </tr>
        </thead>
        <tbody>
        {allPlaylist.map(result => (
        <tr>
          <td>{result.playlistID}</td>
          <td>{result.dataCreated} </td>
          <td>{result.userID}</td>
          <td>{result.playlistName}</td>
        </tr>
        ))}
        </tbody>
        </Table>

  </Form>

    );




  }
}
